import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { listAccessory } from "../actions/accessoryAction";

import Accessory from "./Accessory";
import EmptyStripe from "./EmptyStripe";
import LoadingBox from "./LoadingBox";
import MessageBox from "./MessageBox";

export default function Accessories() {
  const dispatch = useDispatch();
  const accessoryList = useSelector( (state) => state.accessoryList);
  const {loading, error, productAccessories } = accessoryList;

  useEffect(() => {
    dispatch(listAccessory());
  }, [dispatch]);
  return (
    <div>
      <EmptyStripe />
      <section class="category" id="category">
        <div class="max-width">
          {loading ? (
            <LoadingBox></LoadingBox>
          ) : error ? (
            <MessageBox variant="error">{error}</MessageBox>
          ) : (
            <div class="category-content">
              {productAccessories.map((productAccessory) => (
                <Accessory
                  key={productAccessory._id}
                  productAccessory={productAccessory}
                ></Accessory>
              ))}
            </div>
          )}
        </div>
      </section>
    </div>
  );
}
